import React from "react";
import { Button } from "@mui/material";
import logo from "../assets/images/tatvsoft.png";
import ShoppingCartIcon from '@mui/icons-material/ShoppingCart';
function Header(){
    return(
        <div className="header">
            <img src={logo} />
            <div className="button">
                <Button variant="text" color="primary">Login</Button>
                <Button variant="text" color="primary">Register</Button>
                <Button variant="contained" endIcon={<ShoppingCartIcon></ShoppingCartIcon>}>Cart</Button>
            </div>
        </div>
    )
}
export default Header;
